    "/analytics/engines/pa/v3/unlinked-templates": {
      "post": {
        "tags": [
          "UnlinkedPATemplates"
        ],
        "summary": "Create unlinked PA template",
        "description": "This endpoint creates a template which is not linked to any specific PA3 tile. \r\n\r\nRemarks:\r\n\r\n*   Mandatory fields are required to be passed in POST requests and Optional fields are not necessary. \r\n    If no mandatory fields are passed, then we can use the template as a component and skip the component creation.\r\n    \r\n*   Mandatory, optional and locked fields can be  \"accounts\", \"benchmarks\", \"groups\", \"columns\", \"datasources\", \"dates\", \"currencyisocode\" and \"componentdetail\".\r\n\r\n*   We cannot override the Locked fields when creating the Component.\r\n\r\n*   Mandatory and locked strings are mutually exclusive.\r\n\r\n*   Any settings in the POST body will act as a one-time override over the settings saved in the PA template.\r\n\r\n*   Multi-horizon frequencies are not supported through this endpoint.\r\n\r\n*   Componentdetail supports securities, groups, and totals as well but if we don't pass anything that defaults to securities.\r\n\r\n*   If we are overriding the grouping with a frequency, we will be overriding the grouping saved to the original component and also \r\n    overriding the default frequency of the Beginning of Period to whatever we pass in the request body.\r\n    \r\n*   If we are overriding gouping frequency without overriding the group id it will not be applied to the default groupings saved to the original component.",
        "operationId": "createUnlinkedPATemplates",
        "requestBody": {
          "description": "Request Parameters",
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/UnlinkedPATemplateParametersRoot"
              },
              "example": {
                "data": {
                  "directory": "Personal:UnlinkedPATemplates/",
                  "templateTypeId": "996E90B981AEE83F14029ED3D309FB3F03EC6E2ACC7FD42C22CBD5D279502CFD",
                  "description": "This is an unlinked PA template that only returns security level data",
                  "accounts": [
                    {
                      "id": "SPN:SP50",
                      "holdingsmode": "B&H"
                    },
                    {
                      "id": "MSCI_USA:984000",
                      "holdingsmode": "B&H"
                    }
                  ],
                  "benchmarks": [
                    {
                      "id": "SPN:SP50",
                      "holdingsmode": "B&H"
                    },
                    {
                      "id": "DJGX:AMERICAS",
                      "holdingsmode": "B&H"
                    }
                  ],
                  "columns": [
                    {
                      "id": "BD1720474AB8A80BDD79777F5B9CA594F4151C0554E30F9C916BA73BFAFC1FE0",
                      "statistics": [
                        "eb9d6d91416e4224bacadc261787e56f"
                      ]
                    }
                  ],
                  "dates": {
                    "startdate": "20200101",
                    "enddate": "20201215",
                    "frequency": "Monthly"
                  },
                  "groups": [
                    {
                      "id": "5BCFFD17598FAEBD88EB4934EFB5FEF53849867D607ECEF232CD42D3369BBBCA",
                      "frequency": "BeginningOfPeriod"
                    }
                  ],
                  "datasources": {
                    "portfoliopricingsources": [
                      {
                        "id": "39A1C0C7BD46731552B29D913804EC5F3ED91E6B991AF298DEC88CCA2A9FC6B3"
                      }
                    ],
